import React from "react";

import {
  CardContainer,
  CardWrapper,
  CardH2,
  CardP,
} from "../ProjectsSection/ProjectsStyles";

export default function Cards() {
  return (
    <>
      <CardContainer>
        <CardWrapper id="projects">
          <CardH2>Projects</CardH2>
          <CardP>Filter there projects here</CardP>
        </CardWrapper>
      </CardContainer>
    </>
  );
}
